import React from "react";
import { makeStyles } from "@mui/styles";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import { Edit } from "@mui/icons-material";
import image from "../../../../../../assets/images/privacy.jpeg";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "stretch",
  },
  header: {
    height: 286,
    width: "100%",
    backgroundRepeat: "no-repeat",
    backgroundSize: "cover",
    backgroundPosition: "center",
  },
  row: {
    display: "flex",
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
  },
}));

const PrivacyPolicy = () => {
  const classes = useStyles();

  return (
    <div>
      <div>
        <img src={image} alt="featured-img" className={classes.header} />
      </div>
      <div className={classes.row}>
        <Typography variant="h6" color="goldenrod" fontSize={18}>
          Privacy Policy
        </Typography>
        <Button startIcon={<Edit />} variant="contained">
          Edit
        </Button>
      </div>
      <Typography gutterBottom>Last updated on </Typography>
      <Typography></Typography>
    </div>
  );
};

export default PrivacyPolicy;
